BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `pricequotation_pricelevelperitem` (
	`id`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`customprice`	decimal NOT NULL,
	`item_id`	integer NOT NULL,
	`pricelevel_id`	integer NOT NULL,
	FOREIGN KEY(`item_id`) REFERENCES `pricequotation_item`(`id`) DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY(`pricelevel_id`) REFERENCES `pricequotation_pricelevel`(`id`) DEFERRABLE INITIALLY DEFERRED
);
CREATE INDEX IF NOT EXISTS `pricequotation_pricelevelperitem_pricelevel_id_9cadc270` ON `pricequotation_pricelevelperitem` (
	`pricelevel_id`
);
CREATE INDEX IF NOT EXISTS `pricequotation_pricelevelperitem_item_id_627f3066` ON `pricequotation_pricelevelperitem` (
	`item_id`
);
COMMIT;
